import React from 'react';
import { useNavigate } from 'react-router-dom';
import './LandingPage.css';

const LandingPage = () => {
  const navigate = useNavigate();

  const handleGetStarted = () => {
    navigate('/login');
  };

  const handleRegister = () => {
    navigate('/register');
  };

  return (
    <div className="landing-container">
      <div className="landing-content">
        <div className="landing-header">
          <h1 className="landing-title">CursorMail</h1>
          <p className="landing-subtitle">Your Professional Email Management Solution</p>
        </div>
        
        <div className="landing-features">
          <div className="feature">
            <div className="feature-icon">ðŸ“§</div>
            <h3>Smart Email Management</h3>
            <p>Organize your emails efficiently with our intuitive interface</p>
          </div>
          <div className="feature">
            <div className="feature-icon">ðŸ”’</div>
            <h3>Secure & Private</h3>
            <p>Your data is protected with industry-standard security</p>
          </div>
          <div className="feature">
            <div className="feature-icon">âš¡</div>
            <h3>Lightning Fast</h3>
            <p>Experience blazing fast email operations and responses</p>
          </div>
        </div>

        <div className="landing-actions">
          <button className="btn-primary" onClick={handleGetStarted}>
            Get Started
          </button>
          <button className="btn-secondary" onClick={handleRegister}>
            Create Account
          </button>
        </div>

        <div className="landing-footer">
          <p>Already have an account? <span className="login-link" onClick={() => navigate('/login')}>Sign In</span></p>
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
